import React from 'react';
import '../../assets/style/global.css'
import Logo from '../../assets/images/logo.png'

function Header() {
    return (
        <div className="LogoNav">
            <div className="Logo">
                <img src={Logo} alt="Logo do site" />
            </div>
            <div className="Nav">
                <a>Home</a>
                <a>Login</a>
                <a>Cadastro</a>
            </div>
        </div>
    );
}
export default Header;
